import * as React from 'react';
import { View, StyleSheet, Image, ScrollView } from 'react-native';
import CustomPicker from '../../common/CustomPicker';
// import Ionicons from 'react-native-vector-icons/Ionicons';
import CustomText from '../../common/CustomText';
import CustomTextPare from '../../common/CustomTextPare';
import CustomTranscationsBox from '../../common/CustomTranscationsBox';
import SortAlphaUp from '../../PinchImage/SortAlphaUp.png'
import TranscationsText from './TranscationsText/TranscationsText';


function Transcations() {
    return (
        <View style={Styles.transcationsContainer}>
            <View style={{ marginBottom: 20, marginHorizontal: 30, marginVertical: 70 }}>

                <CustomText TitleText="Transcations" />

                <View style={{ flexDirection: 'row', justifyContent: "space-between", marginVertical: 30 }}>
                    <TranscationsText TranscationsText="Round-ups" style={{ fontSize: 16 }} />
                    <TranscationsText TranscationsText="SIP" />
                    <TranscationsText TranscationsText="Gold Invest" />
                </View>

                <View style={{ justifyContent: "space-between", flexDirection: 'row', color: '#FAB0A4' }}>
                    <CustomPicker />
                    <View style={{ flexDirection: 'row' }}>
                        <CustomTextPare TitleTextPare=" Sort by Date" />
                        <Image source={SortAlphaUp} style={{ marginTop: 13 }} />
                    </View>
                </View>

            </View>

            <ScrollView>

                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
                <CustomTranscationsBox />
            </ScrollView>


        </View>


    );
}

export default Transcations;

const Styles = StyleSheet.create({
    transcationsContainer: {
        backgroundColor: "black",
        flex: 1,
    }

})
